import React from "react";

export const Home = () =>{
    return (
        <>
        <div className="box">
            <div className="coverimage">
                <img src="./images/Img1" alt="" />
                <img src="./images/Img2" alt="" />
                <img src="./images/Img3" alt="" />
                <img src="./images/Img4" alt="" />
                <img src="./images/Img5" alt="" />
            </div>
        </div>
        </>
    )
}

export default Home;
